import React from "react";
import { Link, Route } from "react-router-dom";
import Category from "./Category";
import Home from "./Home";
import Products from "./Products";

function App() {
  return (
    <div>
      This is about React Router DOM!
      <ul>
        <li>
          <Link to="/">Homes</Link>
        </li>
      </ul>
      <Route path="/" component={Home} />
    </div>
  );
}

export default App;
